    {
      id: 6,
      name: "ZEBRONICS Zeb-Thunder Wired",
      price: 29,
      image: "/assets/images/1006.png",
    },
  ];

  return (
    <main>
      <section className="products">
        <ProductCard />
      </section>
    </main>
  );
};
